import { NgModule } from '@angular/core';
import { Routes, RouterModule } from '@angular/router';

import { LoginsecretairePage } from './loginsecretaire.page';

const routes: Routes = [
  {
    path: '',
    component: LoginsecretairePage
  }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule],
})
export class LoginsecretairePageRoutingModule {}
